const { Ref } = require("semantic-ui-react");

import React from 'react'

const profile = (props) => {
  return (
    <span style={{ marginLeft: "90%" }}>
    <div> {this.props.Name}</div>
    <img src={this.props.img}></img>
    </span>
  )
}

export default profile
